import './jogos.css'
import { Celula } from '../../models/bingo/celula';
import Select from 'react-select';

function Jogos() {

  const Dimencoes = [
    { label: "2x2", value: 1 },
    { label: "3x3", value: 2 },
    { label: "4x4", value: 3 },
    { label: "5x5", value: 4 },
    { label: "6x6", value: 5 },
  ];

  return (
    <div className="jogos">
      <div id='bingo'>
        <Celula text={"cu"} />
      </div>
      <div className='lista'>
        <h1>Jogos de Medo</h1>
        <input></input>
        <div className="container">
        <div className="row">
          <div className="col-md-3"></div>
          <div className="col-md-6">
            <Select options={Dimencoes} />
          </div>
          <div className="col-md-4"></div>
        </div>
      </div>
      </div>
    </div>
  );
}

export default Jogos;
